      __html:
        '\n\n  /*  PAGE LAYOUT STYLES */\n  .fb-page-layout {\n    background-color: var(--color-bg, var(--fallback-color-bg, white));\n  }\n\n  .fb-flex-row {\n    height: 100vh;\n    display: flex;\n    flex-direction: row;\n  }\n\n  .fb-sidebar {\n    width: 264px;\n    padding-top: 4px;\n    display: flex;\n    flex-direction: column;\n  }\n\n  .fb-sidebar > :nth-last-child(2) {\n    opacity: 0.6;\n  }\n\n  .fb-sidebar > :nth-last-child(1) {\n    opacity: 0.3;\n  }\n\n  .fb-page {\n    display: flex;\n    flex-direction: column;\n    flex-grow: 1;\n    border-left: 1px var(--color-border) solid;\n  }\n\n  .fb-page-content-columns {\n    overflow: hidden;\n    flex-grow: 1;\n    display: flex;\n    flex-direction: row;\n  }\n\n  .fb-page-content {\n    flex-grow: 1;\n    overflow: hidden;\n    position: relative;\n    margin-right: 32px;\n  }\n\n  .fb-page-right-column {\n    width: 304px;\n    margin-top: 24px;\n    margin-right: 16px;\n    padding-left: 32px;\n  }\n\n  .fb-fading-content {\n    margin-left: 32px;\n  }\n\n  /* This is what applies the fading gradient over the skeletons */\n  .fb-fading-content:after {\n    position: absolute;\n    bottom: 0;\n    height: 100%;\n    width: 100%;\n    content: "";\n    background: linear-gradient(to bottom, transparent 50%, var(--color-bg) 100%);\n    pointer-events: none;\n  }\n\n  /* SIDEBAR STYLES */\n\n  .fb-sidebar-account-and-notifications {\n    padding: 8px 12px;\n    display: flex;\n    flex-direction: row;\n    align-items: center;\n    gap: 8px;\n  }\n\n  .fb-sidebar-searchbar {\n    padding: 0 8px;\n    margin-top: 4px;\n    margin-bottom: 8px;\n  }\n\n  .fb-sidebar-row {\n    padding: 8px 16px;\n    display: flex;\n    flex-direction: row;\n    align-items: center;\n  }\n\n  .fb-sidebar-row :nth-child(2) {\n    margin-left: 12px;\n  }\n\n\n  .fb-divider {\n    height: 1px;\n    background-color: var(--color-border, rgba(0, 0, 0, 0.1));\n    width: 100%;\n    margin-top: 8px;\n    margin-bottom: 10px;\n  }\n\n\n  @media (max-width: 645px) {\n    .fb-sidebar {\n      display: none;\n    }\n  }\n\n  /* RIGHT COLUMN STYLES */\n\n  .fb-page-right-column-header {\n    margin-bottom: 18px;\n  }\n\n  .fb-page-right-column-rows > :not(:first-child) {\n    margin-top: 8px;\n  }\n\n  .fb-page-right-column-lower {\n    margin-top: 35px;\n  }\n\n  .fb-page-right-column-user-list {\n    margin-top: 22px;\n    margin-left: 16px;\n    display: flex;\n    flex-direction: column;\n    gap: 18px;\n  }\n\n  .fb-page-right-column-user {\n    display: flex;\n    flex-direction: row;\n    gap: 16px;\n  }\n\n  .fb-page-right-column-user:nth-child(2) {\n    opacity: 0.6;\n  }\n\n  .fb-page-right-column-user:nth-child(3) {\n    opacity: 0.3;\n  }\n\n  /* Skeleton Item Styles */\n\n  .fb-shrink-0 {\n    flex-shrink: 0;\n  }\n\n  .fb-circle-16 {\n    flex-shrink: 0;\n    background-color: var(--color-bg-secondary, #f0f0f0);\n    height: 16px;\n    width: 16px;\n    border-radius: 9999px;\n  }\n\n  .fb-circle-24 {\n    background-color: var(--color-bg-secondary, #f0f0f0);\n    height: 24px;\n    width: 24px;\n    border-radius: 9999px;\n  }\n\n  .fb-rectangle-16 {\n    background-color: var(--color-bg-secondary);\n    height: 16px;\n    border-radius: 3px;\n  }\n\n  .fb-rectangle-24 {\n    background-color: var(--color-bg-secondary);\n    height: 24px;\n    border-radius: 3px;\n  }\n\n  .fb-rectangle-32 {\n    background-color: var(--color-bg-secondary);\n    height: 32px;\n    border-radius: 8px;\n  }\n\n  .fb-rectangle-36 {\n    background-color: var(--color-bg-secondary);\n    height: 36px;\n    border-radius: 3px;\n  }\n\n  /* Skeleton Item Width Options */\n\n  .fb-width-16 {\n    width: 16px;\n  }\n\n  .fb-width-32 {\n    width: 32px;\n  }\n\n  .fb-width-36 {\n    width: 36px;\n  }\n\n  .fb-width-50 {\n    width: 50px;\n  }\n\n  .fb-width-55 {\n    width: 55px;\n  }\n\n  .fb-width-60 {\n    width: 60px;\n  }\n\n  .fb-width-70 {\n    width: 70px;\n  }\n\n  .fb-width-80 {\n    width: 80px;\n  }\n\n  .fb-width-88 {\n    width: 88px;\n  }\n\n  .fb-width-100 {\n    width: 100px;\n  }\n\n  .fb-width-105 {\n    width: 105px;\n  }\n\n  .fb-width-115 {\n    width: 115px;\n  }\n\n  .fb-width-120 {\n    width: 120px;\n  }\n\n  .fb-width-148 {\n    width: 148px;\n  }\n\n  .fb-width-167 {\n    width: 167px;\n  }\n\n  .fb-width-180 {\n    width: 180px;\n  }\n\n  .fb-width-200 {\n    width: 200px;\n  }\n\n  .fb-width-240 {\n    width: 240px;\n  }\n\n  .fb-width-248 {\n    width: 248px;\n  }\n\n  .fb-width-256 {\n    width: 256px;\n  }\n\n  .fb-width-272 {\n    width: 272px;\n  }\n\n  .fb-width-full {\n    width: 100%;\n  }\n\n  /* Header Styles */\n\n  .fb-toolbar-48 {\n    border-bottom: 1px var(--color-border, #e5e5e5) solid;\n    height: 48px;\n    display: flex;\n    flex-shrink: 0;\n    align-items: center;\n    padding-left: 32px;\n  }\n\n  .fb-toolbar-64 {\n    border-bottom: 1px var(--color-border, #e5e5e5) solid;\n    height: 64px;\n    /* We have 10px above the toolbar in the actual page */\n    margin-top: 10px;\n    display: flex;\n    flex-shrink: 0;\n    align-items: center;\n    padding-left: 32px;\n  }\n\n  .fb-toolbar-84 {\n    border-bottom: 1px var(--color-border, #e5e5e5) solid;\n    height: 80px;\n    /* We have 4px above the toolbar in the actual page */\n    margin-top: 4px;\n    display: flex;\n    flex-shrink: 0;\n    align-items: center;\n    padding-left: 32px;\n  }\n\n  .fb-toolbar-84 :nth-child(2) {\n    margin-left: 12px;\n  }\n\n  .fb-breadcrumb {\n    height: 48px;\n    display: flex;\n    flex-shrink: 0;\n    align-items: center;\n    padding-left: 32px;\n  }\n\n  .fb-header {\n    height: 64px;\n    display: flex;\n    flex-shrink: 0;\n    flex-direction: row;\n    align-items: center;\n    padding-left: 32px;\n  }\n\n  .fb-header :nth-child(2) {\n    margin-left: 12px;\n  }\n\n  .fb-viewbar {\n    padding-left: 32px;\n    height: 64px;\n    align-items: center;\n    display: flex;\n    flex-direction: row;\n    justify-content: space-between;\n  }\n\n  /* Page Content: Tile Grid */\n\n  .fb-tile-grid {\n    display: grid;\n    gap: 32px;\n    justify-items: stretch;\n    /* Keep this grid template in line with the grid-template-columns in `shared/views/items_view/grid_view/grid_view.tsx` */\n    grid-template-columns: repeat(auto-fill, minmax(272px, 1fr));\n  }\n\n  .fb-tile-grid-top-padding {\n    margin-top: 24px;\n  }\n\n  .fb-file-tile-DEPRECATED {\n    display: flex;\n    flex-direction: column;\n  }\n\n  .fb-file-tile-DEPRECATED .fb-rectangle-16 {\n    margin-top: 20px;\n    margin-bottom: 20px\n  }\n\n  .fb-file-thumbnail {\n    background-color: var(--color-bg-secondary);\n    aspect-ratio: 16 / 9;\n  }\n\n  .fb-border-radius-8 {\n    border-radius: 8px;\n  }\n\n  .fb-card {\n    border: 1px solid var(--color-border);\n    border-radius: 13px;\n    overflow: hidden;\n    display: flex;\n    flex-direction: column;\n  }\n\n  .fb-file-card-footer {\n    border-top: 1px solid var(--color-border);\n    padding: 12px 16px;\n    display: flex;\n    flex-direction: row;\n    align-items: center;\n    gap: 12px;\n  }\n\n  .fb-file-card-footer-text-container {\n    display: flex;\n    flex-direction: column;\n    gap: 2px;\n  }\n\n  .fb-project-tile {\n    border: 1px solid var(--color-border);\n    border-radius: 16px;\n    display: flex;\n    flex-direction: column;\n    padding: 24px;\n  }\n\n  .fb-project-tile > :nth-child(2) {\n    margin-top: 16px;\n  }\n\n  .fb-project-tile > :nth-child(3) {\n    margin-top: 8px;\n  }\n\n  .fb-team-tile {\n    border: 1px solid var(--color-border);\n    border-radius: 16px;\n    display: flex;\n    flex-direction: column;\n    padding: 24px;\n  }\n\n  .fb-team-tile > :nth-child(2) {\n    margin-top: 48px;\n  }\n\n  .fb-team-tile > :nth-child(3),\n  .fb-team-tile > :nth-child(4) {\n    margin-top: 8px;\n  }\n\n  .fb-project-preview-grid {\n    display: grid;\n    gap: 12px;\n    justify-items: stretch;\n    grid-template-columns: 1fr 1fr;\n  }\n\n  @media (max-width: 645px) {\n\n    .fb-tile-grid {\n      grid-template-columns: 100%;\n    }\n  }\n\n  .fb-profile-grid-header {\n    margin-top: 24px;\n    margin-bottom: 8px;\n  }\n\n'
